import React from "react";
import styled from "styled-components";

const AddToCartButton = () => {
  const Button = styled.button`
    height: 50px;
    width: 250px;
    color: white;
    background: linear-gradient(pink 50%, hotpink 50%);
  `;
  return (
    <Button>
      <h1>Add to cart</h1>
    </Button>
  );
};

export default AddToCartButton;
